import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";

const PatientHistory = () => {
  const [name, setName] = useState("");
  const [age, setAge] = useState("");
  const [gender, setGender] = useState("");
  const [patientData, setPatientData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const navigate = useNavigate();

  const goBack = () => {
    navigate("/dashboard");
  };

  /* useEffect(() => {
    const fetchPatientData = async () => {
      const token = localStorage.getItem("authToken");
      if (token) {
        try {
          const response = await fetch("/api/protected", {
            headers: {
              Authorization: `Bearer ${token}`,
            },
          });
          if (!response.ok) {
            throw new Error(`HTTP error! status: ${response.status}`);
          }
          const data = await response.json();
          setPatientData(data); // Assuming your protected route returns some user-specific data
          setLoading(false);
        } catch (error) {
          setError(error.message);
          setLoading(false);
          console.error("Error fetching patient data:", error);
        }
      } else {
        setError("Not authenticated");
        setLoading(false);
      }
    };

    fetchPatientData();
  }, []);*/

  if (loading) {
    return <div>Loading patient data...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  return (
    <div className="min-h-screen p-6 flex flex-col items-start">
      <div className="mb-10 mt-12 ml-48 flex items-center gap-4"> {/* Increased ml-28 to ml-48 */}
        <button onClick={goBack}>
          <div>
            <svg
              width="70"
              height="62"
              viewBox="0 0 48 48"
              fill="none"
              xmlns="http://www.w3.org/2000/svg"
            >
              <rect width="48" height="48" rx="16" fill="white" />
              <rect
                x="0.5"
                y="0.5"
                width="47"
                height="47"
                rx="15.5"
                stroke="black"
                strokeOpacity="0.35"
              />
              <path
                fillRule="evenodd"
                clipRule="evenodd"
                d="M26.9315 27.9596C27.1647 28.1969 27.1655 28.5824 26.9333 28.8207C26.7221 29.0374 26.391 29.0577 26.1573 28.8814L26.0904 28.8226L21.2824 23.9319C21.0697 23.7155 21.0504 23.3761 21.2244 23.1373L21.2824 23.069L26.0903 18.1775C26.3236 17.9402 26.701 17.941 26.9332 18.1792C27.1444 18.3959 27.1629 18.7342 26.9893 18.9722L26.9315 19.0403L22.5479 23.5006L26.9315 27.9596Z"
                fill="#040415"
              />
            </svg>
          </div>
        </button>
        <h2 className="text-black text-4xl font-bold">Patient History</h2>
      </div>
      <h2 className="text-black text-xl font-bold mt-2 ml-48">Persistent Symptoms</h2> {/* Increased ml-40 to ml-48 */}
      <div className="grid grid-cols-3 gap-4 mt-5 px-16">
        <div className="-ml-16 w-20 h-10 rounded-xl bg-darkgray flex items-center justify-center"> {/* Increased ml-20 to ml-16 */}
          <button>Fatigue</button>
        </div>
        <div className="w-20 h-10 -mx-8 rounded-xl bg-darkgray flex items-center justify-center"> {/* Increased mx-12 to mx-8 */}
          <button>Joint pain</button>
        </div>
        <div className="w-28 h-10 -ml-2 rounded-xl bg-darkgray flex items-center justify-center"> {/* Increased ml-5 to ml-2 */}
          <button>Tenderness</button>
        </div>
        <button className="-ml-16 mt-6 w-20 h-10 rounded-xl bg-blue font-medium text-white text-lg flex items-center justify-center"> {/* Increased ml-20 to ml-16 */}
          Add
        </button>
      </div>
      <h2 className="text-black text-xl font-bold mx-14 -ml-40 mt-10">Type of Arthritis</h2>
      <div className="grid grid-cols-3 gap-4 mt-5 px-14">
        <div className="-ml-16 w-40 mx-1 h-10 rounded-xl bg-darkgray flex items-center justify-center"> {/* Increased ml-20 to ml-16 */}
          <button>Rheumatoid Arthritis</button>
        </div>
        <div className="w-40 h-10 mx-4 rounded-xl bg-darkgray flex items-center justify-center">
          <button>Osteoarthritis</button>
        </div>
      </div>
      <div className="text-black text-xl font-bold mx-14 -ml-64 mt-5">Name</div>
      <input
        placeholder="Enter your name"
        value={name}
        onChange={(event) => setName(event.target.value)}
        className="text-black bg-white border border-black -ml-10 pt-2 pb-2 pl-5 pr-10 mb-10 w-full rounded-md mt-4"
      />
      <div className="text-black text-xl font-bold mx-14 -ml-72">Age</div>
      <input
        placeholder="Enter your age"
        value={age}
        onChange={(event) => setAge(event.target.value)}
        className="text-black bg-white border border-black -ml-10 pt-2 pb-2 pl-5 pr-10 mb-10 w-full rounded-md mt-4"
      />
      <div className="text-black text-xl font-bold mx-14 -ml-64">Gender</div>
      <input
        placeholder="Enter gender"
        value={gender}
        onChange={(event) => setGender(event.target.value)}
        className="text-black bg-white border border-black -ml-10 pt-2 pb-2 pl-5 pr-10 mb-10 w-full rounded-md mt-4"
      />
      <button className="bg-black text-white text-lg font-bold px-16 py-3 -ml-3 rounded-full mt-2">
        Save
      </button>
    </div>
  );
};

export default PatientHistory;
